クルマの消臭力 シート下専用<br><br><br>大容量300gでしっかり消臭！<br>置き場所を気にせず、見えないところで使える「シート下専用タイプ」です。<br>ミネラル系消臭成分配合で車内の気になるニオイを足元からしっかり消臭します。<br><br>■通常1～2か月効果が持続します。（季節や使用状況により異なります。）<br><br><br><br>【仕様】<br>名称：自動車消臭芳香剤<br>形式：ゲル状<br>内容量：300g<br><br>香り：無香料<br>メーカー：エステー<br>品番：K-61<style type="text/css">
