BLANKY ブランキー<br><br><br>マイナスイオン電荷水配合<br>タバコのニオイに効く消臭剤配合<br>はがしやすい両面テープ付<br><br><br>★使用方法<br><br>●キャップを外し、中栓を取ってください。<br><br>●再びキャップを取り付け、強く締めてください。<br><br>●容器が倒れないように、付属の両面テープで車内の水平な所に固定してください。<br>（取り付けの際は、貼り付け面の光沢剤、ゴミ、ホコリ等をよく拭き取ってください。）<br><br><br>【仕様】<br>名称：自動車用芳香・消臭剤<br>形式：液体<br>内容量：115ml<br><br>香り：ホワイトスカッシュ<br>メーカー：アウグ<br>品番：F-10<style type="text/css">
